import * as types from "./../Constant/ActionTypes";

var initialState = false;

const changeLogin = (state = initialState, action) => {
  switch (action.type) {
    case types.CHANGE_LOGIN_SIGNIN:
      state = !state;
      return state;
    default:
      return state;
  }
};

export default changeLogin;
